    constructor(props, btnName) {
        super(props);
        this.state = {
            btnVal: btnName
        }
    }
    render() {
        return (
            <Fragment>
                <div>
                    <button>hello</button>
                </div>
            </Fragment>
        )
    }
}

export default Button;
